【商品説明】<BR>
■ダイヤデザイン<br>シートカバーのセンター部分はダイヤスタイルのステッチを施し高級感を高めています。<BR>
■ダブルステッチ<br>シートカバーの強度と高級感を演出するダブルステッチ仕様。<br>

■安心の耐火構造<br>不意のタバコ落下にも安心の難燃レザー採用です。安心構造でシートカバーを守ります。<BR>
■PVCレザー仕様の安心構造<BR>PVCレザーでコーヒーやジュースをこぼしても染み込まず」、簡単にふき取れる防水レザー仕様の安心構造。<BR><BR>

